namespace WechatBundle\Http\Controllers;

use App\Http\Controllers\Controller as Controller;
use Dingo\Api\Exception\ResourceException;
use Illuminate\Http\Request;
use Illuminate\Http\Response;
use WechatBundle\Services\OauthService;
use WechatBundle\Services\WeappService;

class Qrcode extends Controller
{
    // 获取小程序二维码
    public function getQrcode(Request $request)
    {
        // ShopEx EcShopX Business Logic Layer
        $wxappAppid = $request->input('appid');
        $companyId = $request->input('company_id');
        if (!$wxappAppid) {
            $templateName = $request->input('temp_name', 'yykweishop');
            $weappService = new WeappService();
            $wxappAppid = $weappService->getWxappidByTemplateName($companyId, $templateName);
        }

        $weappService = new WeappService($wxappAppid, $companyId);

        $input = $request->input();
        unset($input['appname']);
        unset($input['appsecret']);
        unset($input['appid']);
        unset($input['company_id']);
        unset($input['temp_name']);

        if (isset($input['id']) && !isset($input['page'])) {
            $page = 'pages/goodsdetail';
        } else {
            $page = ($input['page'] ?? null) ? $input['page'] : 'pages/index';
        }

        unset($input['page']);
        if (isset($input['distributor_id'])) {
            $input['dtid'] = $input['distributor_id'];
        }
        unset($input['distributor_id']);

        //cxdid: 促销单id；dtid:店铺id；smid:导购员id；uid:会员id(推广员id)
        foreach ($input as $key => $val) {
            if (!$val || $val === 'undefined') {
                unset($input[$key]);
            }
        }
        $share_id = $weappService->getShareId($companyId, $input);
        $scene = http_build_query(['share_id' => $share_id]);
        $qrcode = $weappService->createWxaCodeUnlimit($scene, $page);

        return Response($qrcode)->header('Content-type', 'image/png');
    }

    /**
     * @SWG\Get(
     *     path="/h5app/wxapp/pcqrcode",
     *     summary="获取小程序二维码",
     *     tags={"Qrcode"},
     *     description="获取小程序二维码",
     *     operationId="getPcLoginQrcode",
     *     @SWG\Response( response=200, description="成功返回结构", @SWG\Schema(
     *          @SWG\Property( property="data", type="object",
     *                  @SWG\Property( property="base64Image", type="string", example="data:image/jpg;base64,"),
     *          ),
     *     )),
     * )
     */
    public function getPcQrcode(Request $request)
    {
        $authInfo = $request->get('auth');
        $companyId = $authInfo['company_id'];

        $weappService = new WeappService();
        $wxappAppid = $weappService->getWxappidByTemplateName($companyId);
        if ($request->input('id', 0) && !$request->input('pages')) {
            $page = 'pages/item/espier-detail';
        } else {
            $page = $request->input('pages', 'pages/index');
        }
        if (!$wxappAppid) {
            throw new ResourceException('没有开通小程序');
        }
        $weappService = new WeappService($wxappAppid, $companyId);
        $input = ['cid' => $companyId];
        if ($request->input('id', 0)) {
            $input['id'] = $request->input('id', 0);
        }
        if ($request->input('uid', 0)) {
            $input['uid'] = $request->input('uid', 0);
        }
        if ($request->input('dtid', 0)) {
            $input['dtid'] = $request->input('dtid', 0);
        }
        $scene = http_build_query($input);
        $qrcode = $weappService->createWxaCodeUnlimit($scene, $page);
        $base64 = 'data:image/jpg;base64,' . base64_encode($qrcode);
        return $this->response->array(['base64Image' => $base64]);
    }

    /**
     * @SWG\Get(
     *     path="/h5app/wxapp/pcloginqrcode",
     *     summary="获取小程序二维码",
     *     tags={"Qrcode"},
     *     description="获取小程序二维码",
     *     operationId="getPcLoginQrcode",
     *     @SWG\Response( response=200, description="成功返回结构", @SWG\Schema(
     *          @SWG\Property( property="data", type="object",
     *                  @SWG\Property( property="base64Image", type="string", example="data:image/jpg;base64,"),
     *                  @SWG\Property( property="access_token", type="string", example="DQzvqwGq1lEZ"),
     *          ),
     *     )),
     * )
     */
    public function getPcLoginQrcode(Request $request)
    {
        $authInfo = $request->get('auth');
        $companyId = $authInfo['company_id'];
        $weappService = new WeappService();
        $wxappAppid = $weappService->getWxappidByTemplateName($companyId);
        if (!$wxappAppid) {
            throw new ResourceException('没有开通小程序');
        }
        $oauthService = new OauthService();
        $access_token = $oauthService->accessTokenCreated();
        $weappService = new WeappService($wxappAppid, $companyId);
        $input = [
            'cid' => $companyId,
            't' => $access_token
        ];
        $scene = http_build_query($input);
        $qrcode = $weappService->createWxaCodeUnlimit($scene, 'others/pages/auth/index');

        $base64 = 'data:image/jpg;base64,' . base64_encode($qrcode);
        return $this->response->array(['base64Image' => $base64, 'access_token' => $access_token]);
    }
}
